    "sourceText": "const ToothSpacing = (teeth, tooth_pitch, pitch_line_offset) =>\n  2 * ((teeth * tooth_pitch) / (3.14159265 * 2) - pitch_line_offset);",

    "sourceText": "const ToothProfileToFace = (...points) =>\n  Shape.fromOpenPath(points).loop().fill();",

    "hash": "mDSotqA/cDklcZ0PwvPtAeD1Jptk0ESelwT3T5SGvLo=",
    "sourceText": "export const Pulley = (profile, teeth) => {\n  const pulley_OD = profile.diameter(teeth);\n  const tooth_depth = profile.toothDepth;\n  const tooth_width = profile.toothWidth;\n  const toothDistanceFromCentre = Math.sqrt(\n    Math.pow(pulley_OD / 2, 2) -\n      Math.pow((tooth_width + additionalToothWidth) / 2, 2)\n  );\n  const toothWidthScale = (tooth_width + additionalToothWidth) / tooth_width;\n  const toothDepthScale = (tooth_depth + additionalToothDepth) / tooth_depth;\n  var toothProfile = profile.profile;\n\n  console.log('pulley_OD: %f', pulley_OD);\n  console.log(profile);\n\n  const center = Arc(pulley_OD, pulley_OD);\n\n  //teeth - cut out of shaft\n\n  //Scale tooth up\n  toothProfile = toothProfile.scale(toothWidthScale, toothDepthScale);\n  //Translate it out to where it should be\n  toothProfile = toothProfile.move(0, -toothDistanceFromCentre, 0);\n\n  var teethArray = [];\n  for (let i = 0; i < teeth; i++) {\n    teethArray.push(toothProfile.rz(i / teeth));\n  }\n  const teethToCut = Group(...teethArray);\n\n  return center.cut(teethToCut).clean();\n};",
    "sourceLocation": {

      "id": "Pulley"

    const prepareViews = async (notebook) => {
      // Prepare the view urls in the browser.
      for (const note of notebook) {
        if (note.view && !note.url) {
          note.url = await dataUrl(Shape.fromGeometry(note.data), note.view);
        }
      }
      return notebook;
    }

    const run = async () => {
      const body = document.getElementsByTagName('body')[0];
      const bookElement = document.createElement('div');
      const notebookElement = await toDomElement(await prepareViews(notebook));
      bookElement.appendChild(notebookElement);
      body.appendChild(bookElement);
      bookElement.classList.add('book', 'notebook', 'loaded');
    };

    if (document.readyState === 'complete') {
      run();
    } else {
      document.onreadystatechange = () => {
        if (document.readyState === 'complete') {
          run();
        }
      };
    }
  </script>
